import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { AddUserForm } from './components/AddUserForm';
import CssBaseline from '@mui/material/CssBaseline';
import { HomepageForm } from './components/Homepage'
import { LoginForm } from './components/Loginpage';
import { DeleteUserForm } from './components/DeleteUser'
import { UpdateUserForm } from './components/UpdateUserForm';

const darkTheme = createTheme({
  palette: {
    mode: 'light',
  },
});




const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <ThemeProvider theme={darkTheme}>
    <CssBaseline />
    <BrowserRouter>
      <Routes>
        <Route path="/create-account" element={<AddUserForm />} />
        <Route path="/" element={<HomepageForm/>} />
        <Route path="/login" element={<LoginForm/>} />
        <Route path="/delete-account" element={<DeleteUserForm />}/>
        <Route path="/update-account" element={<UpdateUserForm />}/>

      </Routes>
    </BrowserRouter>
  </ThemeProvider>
);


// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
